<?php\n// Assuming $feed contains the YouTube video entries\n$youtubeVideoIds = [];\nforeach ($feed as $entry) {\n    $youtubeVideoIds[] = $entry->getVideoId();\n}\n\n// Fetch the existing video IDs from the database\n$existingVideoIds = [];\n$rs->MoveFirst();\nwhile (!$rs->EOF) {\n    $existingVideoIds[] = $rs->fields['yt_id'];\n    $rs->MoveNext();\n}\n\n// Find new video IDs that are not in the database\n$newVideoIds = array_diff($youtubeVideoIds, $existingVideoIds);\n\n// Insert new video IDs into the database\nforeach ($newVideoIds as $videoId) {\n    $query = "INSERT INTO videos (yt_id) VALUES ('" . mysql_real_escape_string($videoId) . "')";\n    // Execute the query, assuming you have a connection $conn\n    mysql_query($query, $conn);\n}\n\n// Close the database connection if necessary\nmysql_close($conn);\n?>